import React from "react";

const Projects = () => {
  return (
    <section id="projects" className="section">
      <h2>Projects</h2>
      <div className="project">
        <h3>HYDROSPHERE</h3>
        <p>08/2021 - 05/2022</p>
        <p>
          HYDROSPHERE - Revolutionizing Freshwater Sustainability by Harvesting
          Atmospheric Water in Egypt
        </p>
      </div>
      <div className="project">
        <h3>Do-It ⚡️</h3>
        <p>CS50x 2024 Final Project</p>
        <p>
          Do-It ⚡️ is a simple and user-friendly task manager designed for the
          CS50x 2024 final project. It helps users manage their tasks
          efficiently with an intuitive interface.
        </p>
      </div>
    </section>
  );
};

export default Projects;
